import React, { useState } from 'react';  
import './Home.css';
import { MockData } from '../MockData/HomeMock';
import ReactPaginate from 'react-paginate';
const Home = () => {
  const [Filter, SetFilter] = useState(MockData);
  const [sdata, setSdata] = useState([]);


  //Maping of Data Cards
  let Data = Filter.map((data) => {
    return (
      <div className='container d-flex ' id='inner'>
        <div className="card w-100 mt-5 col-md-3" >
          <img src={data.Img} className="card-img-top" alt="..." />
          <div className="card-body">
            <h5 className="card-title">{data.Title}</h5>
            <p className='card-text'>{data.Author}</p>
            <p className="card-text">{data.Description}</p>
            <a className="btn btn-dark d-flex justify-content-center"  >Show Path</a>
          </div>
        </div>
      </div>
    )
  })



  //Filtering function
  function Filtering(data) {
    const list = MockData.filter((x) => x.category === data);
    console.log(data);
    SetFilter(list);
    console.log(list);
  }


  //Searching
  const searchop = (e) => {
    e.preventDefault();
    var data = document.getElementById('input1').value;
    data=data.toLowerCase();
    let trdata = [];
    MockData.map((e) => {
      let dd = e.Title.toLowerCase();
      const trial = dd.search(data);
      // console.log(trial);
      if (!trial) {
        trdata = [...trdata, e];
      }
      SetFilter(trdata);
    })
    setSdata(trdata);
  }

  //handling page click
  const handlePageClick=(page)=>{
    console.log(page.selected+1);
  }

  return (
    <div>

      {/* Navbar */}
      <nav class="navbar navbar-expand-lg navbar-dark  bg-dark pe-1">
        <div class="container">
          <a class="navbar-brand">SEARCH_LESS</a>
          <form class="d-flex">
            <input class="form-control me-2" type="search_Less" placeholder="Search" aria-label="Search" id='input1'  onKeyUp={searchop}/>
            <button class='btn btn-outline-dark' type='submit'>Admin</button>
            <button class="btn btn-outline-light" type="submit" onClick={searchop} >Search</button>
            <button class='btn btn-outline-dark' type='submit'>Admi</button>
          </form>
        </div>
      </nav>

      {/* Buttons */}
      <div className='container d-flex justify-content-center mt-2 flex-wrap ' id="Cards">
        <button className='btn btn-dark mx-2 mt-3' onClick={() => SetFilter(MockData)}>All</button>
        <button className='btn btn-dark mx-2 mt-3' onClick={() => Filtering("Programming")}>Programming</button>
        <button className='btn btn-dark mx-2 mt-3' onClick={() => Filtering("Course")}>Course</button>
        <button className='btn btn-dark mx-2 mt-3' onClick={() => Filtering("DSA")}>DSA</button>
        <button className='btn btn-dark mx-2 mt-3' onClick={() => Filtering("Chemical")}>Chemical</button>
        <button className='btn btn-dark mx-2 mt-3' onClick={() => Filtering("Physics")}>Physics</button>
        <button className='btn btn-dark mx-2 mt-3' onClick={() => Filtering("Maths")}>Maths</button>
      </div>

      {/* Data Card */}
      <div className='container d flex' id="Outer-Home">
        {Data}
      </div>
      <nav aria-label="...">
  <ul class="pagination">
    <li class="page-item disabled">
      <a class="page-link" href="#" tabindex="-1" aria-disabled="true">Previous</a>
    </li>
    <li class="page-item disabled "><a class="page-link" href="#">1</a></li>
    <li class="page-item" aria-current="page">
      <a class="page-link" href="#">2</a>
    </li>
    <li class="page-item"><a class="page-link" href="#">3</a></li>
    <li class="page-item">
      <a class="page-link" href="#">Next</a>
    </li>
  </ul>
</nav>
      <ReactPaginate 
        previousLabel={'<<'}
        breakLabel={'...'} 
        marginPagesDisplayed={2}
        pageRangeDisplayed={7}
        pageCount={100}
        nextLabel={'>>'}
        onPageChange={handlePageClick}
      />
    </div>

  )
}

export default Home
